script: |
  super -f text -I q95.spq | sort > q95.out

inputs:
  - name: q95.spq
    data: |
      SELECT ALL - col0 * 31 - - CAST ( NULL AS INTEGER ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 81 / - - col1 * + 85 NOT IN ( - - col2, 2 * + col2, ( + col2 ) );
  - name: tab1

outputs:
  - name: q95.out
    data: |
